create or replace view anan_user_all_permissions as
select `a`.`id`          AS `id`,
       `a`.`code`        AS `code`,
       `a`.`p_id`        AS `p_id`,
       `a`.`name`        AS `name`,
       `a`.`url`         AS `url`,
       `a`.`type`        AS `type`,
       `a`.`level`       AS `level`,
       `a`.`sort`        AS `sort`,
       `a`.`status`      AS `status`,
       `a`.`service_id`  AS `service_id`,
       `a`.`route_path`  AS `route_path`,
       `a`.`path`        AS `path`,
       `a`.`method`      AS `method`,
       `a`.`icon`        AS `icon`,
       `a`.`create_time` AS `create_time`,
       `a`.`create_by`   AS `create_by`,
       `a`.`update_time` AS `update_time`,
       `a`.`update_by`   AS `update_by`,
       0                 AS `add_mode`,
       `c`.`user_id`     AS `user_id`,
       `c`.`role_id`     AS `role_id`,
       `c`.`organiz_id`  AS `organiz_id`
from ((`anan_platform`.`anan_permission` `a` join `anan_platform`.`anan_role_permission` `b`)
         join `anan_platform`.`anan_user_role` `c`)
where ((`a`.`id` = `b`.`permission_id`) and (`b`.`role_id` = `c`.`role_id`))
union
select `a`.`id`          AS `id`,
       `a`.`code`        AS `code`,
       `a`.`p_id`        AS `p_id`,
       `a`.`name`        AS `name`,
       `a`.`url`         AS `url`,
       `a`.`type`        AS `type`,
       `a`.`level`       AS `level`,
       `a`.`sort`        AS `sort`,
       `a`.`status`      AS `status`,
       `a`.`service_id`  AS `service_id`,
       `a`.`route_path`  AS `route_path`,
       `a`.`path`        AS `path`,
       `a`.`method`      AS `method`,
       `a`.`icon`        AS `icon`,
       `a`.`create_time` AS `create_time`,
       `a`.`create_by`   AS `create_by`,
       `a`.`update_time` AS `update_time`,
       `a`.`update_by`   AS `update_by`,
       `b`.`add_mode`    AS `add_mode`,
       `b`.`user_id`     AS `user_id`,
       0                 AS `role_id`,
       `b`.`organiz_id`  AS `organiz_id`
from (`anan_platform`.`anan_permission` `a`
         join `anan_platform`.`anan_user_permission` `b`)
where (`a`.`id` = `b`.`permission_id`);

